script: |
  super -f tsv -I q5535.sql | sort > q5535.out

vector: true

inputs:
  - name: q5535.sql
    data: |
      SELECT - 19 AS col0, 5 * + CAST ( NULL AS REAL ) AS col1 FROM tab2 WHERE + col0 NOT BETWEEN - col1 AND - col2 * - col1 * - col1 + - col1;
  - name: tab2

outputs:
  - name: q5535.out
    data: |
      -19	NULL
      -19	NULL
      -19	NULL
